import React from "react"

class Users extends React.Component {

    constructor (props) {
        super(props)
        this.state = {
            users: [
                {
                    id: 1,
                    firstname: 'Bob',
                    lastname: 'Marley',
                    bio: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit. Repell',
                    age: 40,
                    isHappy: true
                },
                {
                    id: 2,
                    firstname: 'John',
                    lastname: 'Doe',
                    bio: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit. Repell',
                    age: 22,
                    isHappy: false

                }
            ]
        }
    }

    render () {
      return (
        <div>
            {this.state.users.map((el) => (
                <div className="user" key={el.id}>
                    <h3>{el.firstname} {el.lastname}</h3>
                    <p>{el.bio}</p>
                    <b>{el.isHappy ? "Happy" : "Unhappy"}</b>
                </div>
            ))}
        </div>
      )
    }

}

export default Users
